/*Table structure for table `department` */

DROP TABLE IF EXISTS `department`;

CREATE TABLE `department` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `company_id` int(10) DEFAULT NULL,
  `name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `company_id` (`company_id`,`name`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `department` */

insert  into `department`(`id`,`company_id`,`name`) values (1,1,'Administration'),(5,1,'Audit'),(4,1,'Finance'),(3,1,'Human Resources'),(8,1,'Information Technology'),(7,1,'Logistics'),(6,1,'Research & Development'),(2,1,'Sales');

/*Table structure for table `device` */

DROP TABLE IF EXISTS `device`;

CREATE TABLE `device` (
  `id` int(38) NOT NULL AUTO_INCREMENT,
  `imei` varchar(20) CHARACTER SET latin1 NOT NULL,
  `date_created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `normal` (`imei`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `device` */

insert  into `device`(`id`,`imei`,`date_created`) values (1,'358265011442891','2016-08-11 00:26:54');

/*Table structure for table `employee` */

DROP TABLE IF EXISTS `employee`;

CREATE TABLE `employee` (
  `id` int(15) NOT NULL AUTO_INCREMENT,
  `employee_code` varchar(20) CHARACTER SET latin1 DEFAULT NULL,
  `company_id` int(10) DEFAULT '1',
  `first_name` varchar(50) CHARACTER SET latin1 DEFAULT NULL,
  `middle_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `last_name` varchar(50) CHARACTER SET latin1 DEFAULT NULL,
  `address` varchar(50) CHARACTER SET latin1 DEFAULT NULL,
  `phone_no` varchar(25) CHARACTER SET latin1 DEFAULT NULL,
  `email` varchar(50) CHARACTER SET latin1 DEFAULT NULL,
  `gender` enum('Male','Female') COLLATE utf8_unicode_ci DEFAULT 'Male',
  `dob` date DEFAULT NULL,
  `idcard_no` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `pic` longtext COLLATE utf8_unicode_ci,
  `about_me` varchar(250) COLLATE utf8_unicode_ci DEFAULT 'Great Guy',
  `created_dtt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `update_dtt` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `employee_code` (`employee_code`,`first_name`,`last_name`,`middle_name`),
  KEY `normal` (`first_name`,`last_name`,`email`,`employee_code`,`company_id`,`gender`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

