/*Table structure for table `employee_bin` */

DROP TABLE IF EXISTS `employee_bin`;

CREATE TABLE `employee_bin` (
  `id` int(38) NOT NULL AUTO_INCREMENT,
  `employee_id` int(38) DEFAULT NULL,
  `product_id` int(38) DEFAULT NULL,
  `product_uom_id` int(38) DEFAULT NULL,
  `quantity` decimal(10,2) DEFAULT NULL,
  `start_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `end_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `employee_id` (`employee_id`,`product_id`,`start_date`,`end_date`),
  KEY `product_id` (`product_id`),
  KEY `product_uom_id` (`product_uom_id`),
  CONSTRAINT `employee_bin_ibfk_1` FOREIGN KEY (`employee_id`) REFERENCES `employee` (`id`),
  CONSTRAINT `employee_bin_ibfk_2` FOREIGN KEY (`product_id`) REFERENCES `product` (`product_id`),
  CONSTRAINT `employee_bin_ibfk_3` FOREIGN KEY (`product_uom_id`) REFERENCES `product_uom` (`product_uom_id`)
