CREATE TABLE `sales` (
  `id` int(38) NOT NULL AUTO_INCREMENT,
  `route_id` bigint(20) DEFAULT NULL,
  `sales_volume` decimal(10,2) DEFAULT NULL,
  `sales_value` decimal(10,2) DEFAULT NULL,
  `sales_date` date DEFAULT NULL,
  `start_time` time DEFAULT NULL,
  `sales_time` time DEFAULT NULL,
  `latitude` double DEFAULT NULL,
  `longitude` double DEFAULT NULL,
  `entry_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `route_id` (`route_id`),
  CONSTRAINT `sales_ibfk_2` FOREIGN KEY (`route_id`) REFERENCES `route` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `sales` */

/*Table structure for table `sales_product` */

DROP TABLE IF EXISTS `sales_product`;

CREATE TABLE `sales_product` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `sales_id` int(38) DEFAULT NULL,
  `employee_bin_id` int(38) DEFAULT NULL,
  `quantity` decimal(10,2) DEFAULT NULL,
  `amount` decimal(10,2) DEFAULT NULL,
  `inventory` decimal(10,2) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `sales_id` (`sales_id`),
  KEY `employee_bin_id` (`employee_bin_id`),
  CONSTRAINT `sales_product_ibfk_1` FOREIGN KEY (`sales_id`) REFERENCES `sales` (`id`),
  CONSTRAINT `sales_product_ibfk_2` FOREIGN KEY (`employee_bin_id`) REFERENCES `employee_bin` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `sales_product` */

/*Table structure for table `state` */

DROP TABLE IF EXISTS `state`;

CREATE TABLE `state` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

