  `username` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `password` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `role_id` int(10) DEFAULT '1',
  `status` int(1) DEFAULT '1',
