/* Procedure structure for procedure `create_account` */

/*!50003 DROP PROCEDURE IF EXISTS  `create_account` */;

DELIMITER $$

/*!50003 CREATE  PROCEDURE `create_account`(username VARCHAR(50),pass VARCHAR(50), fname VARCHAR(50), lname VARCHAR(50), OUT user_id INT)
    MODIFIES SQL DATA
BEGIN
	DECLARE emp_id INT DEFAULT 0;
	DECLARE brn_id INT DEFAULT 1;
	DECLARE chn_id INT DEFAULT 1;
	DECLARE jbt_id INT DEFAULT 1;
	DECLARE mod_id INT DEFAULT 1;
	DECLARE mgr_id INT DEFAULT 1;
	INSERT INTO employee(first_name,last_name) VALUES(fname,lname);
	SET emp_id = LAST_INSERT_ID();
	
	INSERT INTO `user`(employee_id,username,`password`) VALUES(emp_id,username,MD5(pass));	
	SET user_id = LAST_INSERT_ID();
	
	INSERT INTO employee_branch(employee_id,branch_id) VALUES(emp_id,brn_id);
	
	INSERT INTO employee_channel(employee_id,channel_id) VALUES(emp_id,chn_id);
	
	INSERT INTO employee_job_title(employee_id,job_title_id) VALUES(emp_id,jbt_id);
	
	INSERT INTO employee_bin(employee_id,product_id,product_uom_id,quantity,start_date,end_date) 
     SELECT emp_id,product_id,product_uom_id,quantity,start_date,end_date FROM employee_bin WHERE employee_id = (SELECT MAX(employee_id) FROM employee_bin);     
     
	INSERT INTO employee_permission(manager_id, subordinate_id) VALUES(emp_id,emp_id);
	INSERT INTO employee_permission(manager_id, subordinate_id) VALUES(mgr_id,emp_id);
	
	INSERT INTO user_company_module(user_id, company_module_id) VALUES(user_id,mod_id);
		
    END */$$
DELIMITER ;

