/* Procedure structure for procedure `create_product` */

/*!50003 DROP PROCEDURE IF EXISTS  `create_product` */;

DELIMITER $$

/*!50003 CREATE  PROCEDURE `create_product`(prod_cat_id INT,prod_code VARCHAR(30),prod_name VARCHAR(100), OUT result INT)
    MODIFIES SQL DATA
BEGIN
	DECLARE a_finish BOOLEAN DEFAULT FALSE;	
	DECLARE uom_id INTEGER DEFAULT 0;
	DECLARE um VARCHAR(20) DEFAULT '';
	DECLARE prize DECIMAL DEFAULT 0;
	DECLARE uom_c CURSOR FOR SELECT product_uom_id, uom from product_uom;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET a_finish = TRUE;
	INSERT INTO product(product_category_id,product_code,product_name) VALUES(prod_cat_id,prod_code,prod_name);
	SET result = LAST_INSERT_ID();
	
	OPEN uom_c;
         fetch_uom: LOOP
         FETCH uom_c INTO uom_id,um;      
         IF a_finish THEN LEAVE fetch_uom; END IF;
	 INSERT INTO product_price(product_id,product_uom_id,price,start_date) VALUES(result,uom_id,prize,CURDATE());			
	END LOOP fetch_uom;
        CLOSE uom_c;     
        SELECT 1 INTO @handler_invoked FROM (SELECT 1) AS t; 
    END */$$
DELIMITER ;

