/* Procedure structure for procedure `customer_list` */

/*!50003 DROP PROCEDURE IF EXISTS  `customer_list` */;

DELIMITER $$

/*!50003 CREATE  PROCEDURE `customer_list`(usr_id INT,start_row INT, quantity INT, search VARCHAR(50))
    READS SQL DATA
BEGIN
	DECLARE emp_id INTEGER DEFAULT 0;
	SELECT employee_id INTO emp_id FROM `user` WHERE id = usr_id;
	    
    SELECT a.customer_id, a.outlet_name, a.outlet_address, a.phone_no, a.email, a.first_name, a.last_name, a.dob, 
    a.city, a.state, a.latitude, a.longitude,DATE_FORMAT(a.entry_dtt,'%d/%m/%Y') AS date_created 
    FROM customer a, employee_customer b     
    WHERE a.customer_id = b.customer_id 
    AND b.end_date LIKE '0000-00-00 00:00:00'
    AND b.employee_id IN(SELECT subordinate_id FROM employee_permission WHERE manager_id = emp_id)
    AND (
    a.customer_id = search 
    OR LOWER(a.outlet_name) LIKE CONCAT('%',LOWER(search),'%') 
    OR LOWER(a.outlet_address) LIKE CONCAT('%',LOWER(search),'%')
    OR LOWER(a.phone_no) LIKE CONCAT('%',LOWER(search),'%')
    OR LOWER(a.email) LIKE CONCAT('%',LOWER(search),'%') 
    OR LOWER(a.first_name) LIKE CONCAT('%',LOWER(search),'%') 
    OR LOWER(a.last_name) LIKE CONCAT('%',LOWER(search),'%') 
    OR LOWER(a.dob) LIKE CONCAT('%',LOWER(search),'%') 
    OR LOWER(a.city) LIKE CONCAT('%',LOWER(search),'%')
    OR LOWER(a.state) LIKE CONCAT('%',LOWER(search),'%')
    OR LOWER(a.entry_dtt) LIKE CONCAT('%',LOWER(search),'%')
    );   
    /*LIMIT start_row, quantity;*/
    END */$$
DELIMITER ;

