WHERE a.task_id = b.task_id 
AND a.employee_id = emp_id 
AND a.task_date = entry_date 
AND b.task_label = the_task
AND b.lang = the_lang;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `employee_task_trend` */

