DELIMITER $$

/*!50003 CREATE  PROCEDURE `employee_task_trend`(the_task_id INT,start_date DATE, end_date DATE)
    READS SQL DATA
BEGIN
	SET SESSION group_concat_max_len = 1000000;	
	SELECT e.name AS depot, CONCAT(c.first_name,' ',c.last_name) AS rep_name, 
	 (SELECT GROUP_CONCAT(CONCAT(a.task_date,'~',a.task_time) SEPARATOR '|') FROM employee_task a, task b WHERE a.task_id = b.task_id 
	AND a.employee_id = c.id
	AND a.task_date BETWEEN start_date AND end_date
	AND b.task_id = the_task_id) AS 'dates' 
	FROM employee c, employee_branch d, branch e 
	WHERE c.id = d.employee_id 
	AND d.end_date LIKE '0000-00-00 00:00:00'
	AND e.id = d.branch_id;
    END */$$
DELIMITER ;

