    READS SQL DATA
BEGIN
	SELECT d.outlet_name, d.outlet_address,d.phone_no, a.sales_time, 
(SELECT GROUP_CONCAT(CONCAT(h.product_id,':',e.quantity) SEPARATOR '|')  
FROM sales_product e, employee_bin f, product g, product h 
WHERE a.id = e.sales_id 
AND e.employee_bin_id = f.id 
