/* Procedure structure for procedure `login_mobile` */

/*!50003 DROP PROCEDURE IF EXISTS  `login_mobile` */;

DELIMITER $$

/*!50003 CREATE  PROCEDURE `login_mobile`(stat INT(1),user_name VARCHAR(50),pass_word VARCHAR(50),imei VARCHAR(20),lang CHAR(2))
    MODIFIES SQL DATA
BEGIN
	SET SESSION group_concat_max_len = 1000000;
	SELECT a.employee_id, b.first_name, b.last_name,GROUP_CONCAT(CONCAT(f.task_id,'~',f.task_label,'~',f.task,'~',f.task_type,'~',IFNULL((SELECT z.task_time FROM employee_task z WHERE z.task_date = CURDATE() AND f.task_id = z.task_id AND a.employee_id = z.employee_id),'')) ORDER BY f.task_id SEPARATOR '|') AS tasks,
              h.name AS depot,h.latitude,h.longitude                
                FROM `user` a, employee b, employee_device c, device d, employee_channel e, task f, employee_branch g, branch h
                WHERE a.employee_id = b.id                
                AND c.device_id = d.id
                AND c.employee_id = b.id
                AND c.end_date = '0000-00-00 00:00:00'
                AND a.employee_id = e.employee_id
                AND e.end_date = '0000-00-00 00:00:00'
                AND e.channel_id = f.channel_id  
                AND a.employee_id = g.employee_id
                AND g.end_date = '0000-00-00 00:00:00'      
                AND g.branch_id = h.id     
                AND a.status=stat
                AND a.username = user_name 
                AND a.password = MD5(pass_word)
              AND d.imei = imei 
              AND f.lang = lang;
    END */$$
DELIMITER ;

