/* Procedure structure for procedure `populate_bin` */

/*!50003 DROP PROCEDURE IF EXISTS  `populate_bin` */;

DELIMITER $$

/*!50003 CREATE  PROCEDURE `populate_bin`()
    MODIFIES SQL DATA
BEGIN
     DECLARE a_finish BOOLEAN DEFAULT FALSE;
     DECLARE emp_bin_id INTEGER DEFAULT 0;
     DECLARE visit_date DATE DEFAULT CURDATE();
     DECLARE bin_c CURSOR FOR 
     SELECT id FROM employee_bin 
     WHERE end_date LIKE '0000-00-00 00:00:00';
     
     DECLARE CONTINUE HANDLER FOR NOT FOUND SET a_finish = TRUE;
     OPEN bin_c;
     fetch_bin: LOOP
      FETCH bin_c INTO emp_bin_id;      
      IF a_finish THEN LEAVE fetch_bin; END IF;
      INSERT INTO employee_bin_daily(employee_bin_id,visit_date) VALUES(emp_bin_id,visit_date);
            
     END LOOP fetch_bin;
     CLOSE bin_c;     
      SELECT 1 INTO @handler_invoked FROM (SELECT 1) AS t;     
    END */$$
DELIMITER ;

/* Procedure structure for procedure `populate_dates` */

/*!50003 DROP PROCEDURE IF EXISTS  `populate_dates` */;

DELIMITER $$

/*!50003 CREATE  PROCEDURE `populate_dates`(p_start_date DATE, p_end_date DATE)
BEGIN
DECLARE v_date DATE;
SET v_date = p_start_date;
WHILE v_date <= p_end_date
DO
  INSERT IGNORE INTO dates (the_date) VALUES (v_date);
  SET v_Date = DATE_ADD(v_date, INTERVAL 1 DAY);
END WHILE;
END */$$
DELIMITER ;

/* Procedure structure for procedure `populate_route` */

/*!50003 DROP PROCEDURE IF EXISTS  `populate_route` */;

DELIMITER $$

/*!50003 CREATE  PROCEDURE `populate_route`()
    MODIFIES SQL DATA
BEGIN
     DECLARE a_finish boolean DEFAULT false;
     DECLARE emp_cust_id INTEGER DEFAULT 0;
     DECLARE visit_date DATE DEFAULT CURDATE();
     DECLARE route_c CURSOR FOR 
     SELECT a.id from employee_customer a, customer_visit_day b  
     WHERE a.customer_id = b.customer_id 
     AND a.end_date LIKE '0000-00-00 00:00:00'
     AND b.end_date LIKE '0000-00-00 00:00:00'
     AND b.visit_day_id = DAYOFWEEK(visit_date)
     AND a.id NOT IN(SELECT employee_customer_id FROM route WHERE visit_date = visit_date);
     
     DECLARE CONTINUE HANDLER FOR NOT FOUND SET a_finish = true;
     OPEN route_c;
     fetch_route: LOOP
      FETCH route_c INTO emp_cust_id;      
      IF a_finish THEN LEAVE fetch_route; END IF;
      INSERT INTO route(employee_customer_id,visit_date) VALUES(emp_cust_id,visit_date);
            
     END LOOP fetch_route;
     CLOSE route_c;     
      SELECT 1 INTO @handler_invoked FROM (SELECT 1) AS t;     
    END */$$
DELIMITER ;

/* Procedure structure for procedure `populate_times` */

/*!50003 DROP PROCEDURE IF EXISTS  `populate_times` */;

DELIMITER $$

/*!50003 CREATE  PROCEDURE `populate_times`(p_start_time DATETIME, p_end_time DATETIME)
BEGIN
DECLARE v_time DATETIME;
SET v_time = p_start_time;
WHILE v_time <= p_end_time
DO
  INSERT IGNORE INTO times (the_time) VALUES (v_time);
  SET v_time = DATE_ADD(v_time, INTERVAL 10 MINUTE);
END WHILE;
END */$$
DELIMITER ;

