/* Procedure structure for procedure `task_completion` */

/*!50003 DROP PROCEDURE IF EXISTS  `task_completion` */;

DELIMITER $$

/*!50003 CREATE  PROCEDURE `task_completion`(usr_id INT,task_lang CHAR(2))
    READS SQL DATA
BEGIN
	DECLARE emp_id INTEGER DEFAULT 0;
	SELECT employee_id INTO emp_id FROM `user` WHERE id = usr_id;
	
	SELECT b.task, (SELECT COUNT(c.employee_id) FROM employee_task c WHERE a.id=c.id AND c.task_time BETWEEN '6:00:00' AND '7:00:00') AS 'seven',
(SELECT COUNT(c.employee_id) FROM employee_task c WHERE a.id=c.id AND c.task_time BETWEEN '7:00:00' AND '8:00:00') AS 'eight',
(SELECT COUNT(c.employee_id) FROM employee_task c WHERE a.id=c.id AND c.task_time BETWEEN '8:00:00' AND '9:00:00') AS 'nine',
(SELECT COUNT(c.employee_id) FROM employee_task c WHERE a.id=c.id AND c.task_time BETWEEN '9:00:00' AND '10:00:00') AS 'ten',
(SELECT COUNT(c.employee_id) FROM employee_task c WHERE a.id=c.id AND c.task_time BETWEEN '10:00:00' AND '11:00:00') AS 'eleven',
(SELECT COUNT(c.employee_id) FROM employee_task c WHERE a.id=c.id AND c.task_time BETWEEN '11:00:00' AND '12:00:00') AS 'twelve',
(SELECT COUNT(c.employee_id) FROM employee_task c WHERE a.id=c.id AND c.task_time BETWEEN '12:00:00' AND '13:00:00') AS 'one',
(SELECT COUNT(c.employee_id) FROM employee_task c WHERE a.id=c.id AND c.task_time BETWEEN '13:00:00' AND '14:00:00') AS 'two'
FROM employee_task a, task b WHERE a.task_id = b.task_id 
AND b.task_label IN('resume_to_work','load_stock','depart_to_trade') AND b.lang = task_lang
AND a.task_date = CURDATE()
AND a.employee_id IN(SELECT subordinate_id FROM employee_permission WHERE manager_id = emp_id)
GROUP BY b.task_label
ORDER BY b.task_id;
    END */$$
DELIMITER ;

