DELIMITER $$

/*!50003 CREATE  PROCEDURE `update_employee_user`(employee_id INT,pass_word VARCHAR(50),
	employee_code VARCHAR(20), first_name VARCHAR(50), middle_name VARCHAR(50), last_name VARCHAR(50),
	address VARCHAR(50),phone_no VARCHAR(50),email VARCHAR(50), gender varCHAR(10), dob DATE,
	idcard_no VARCHAR(20), about_me VARCHAR(250), out result INT
    )
    MODIFIES SQL DATA
BEGIN
	UPDATE employee a INNER JOIN `user` b ON a.id = b.employee_id
           SET
           a.employee_code = employee_code,
           a.first_name = first_name,
           a.middle_name = middle_name,                     
           a.last_name = last_name,
           a.address = address, 
           a.phone_no = phone_no,
           a.email = email,  
           a.gender = gender,
           a.dob = dob,
           a.idcard_no = idcard_no,                  
           a.about_me = about_me,
           a.update_dtt = NOW(),
           b.password = MD5(pass_word)
          WHERE a.id = employee_id;
          set result = row_count();
    END */$$
DELIMITER ;

/* Procedure structure for procedure `update_price` */

