/*!50003 CREATE  PROCEDURE `update_price`(prod_price_id INT,prod_uom_id INT, prize DECIMAL, OUT result INT)
    MODIFIES SQL DATA
BEGIN
	DECLARE prod_id INTEGER DEFAULT 0;
	
	SELECT product_id INTO prod_id FROM product_price WHERE product_price_id = prod_price_id;
