/* Procedure structure for procedure `ytd_sales` */

/*!50003 DROP PROCEDURE IF EXISTS  `ytd_sales` */;

DELIMITER $$

/*!50003 CREATE  PROCEDURE `ytd_sales`(sales_year YEAR, usr_id INT)
    READS SQL DATA
BEGIN
	DECLARE emp_id INTEGER DEFAULT 0;
	SELECT employee_id INTO emp_id FROM `user` WHERE id = usr_id;
	
	SELECT f.category_name, (SELECT SUM(b.quantity) FROM sales a, sales_product b, employee_bin c, product d, product_category e 
WHERE a.id = b.sales_id 
AND DATE_FORMAT(a.sales_date,"%m-%Y") = concat("01-",sales_year)
AND b.employee_bin_id = c.id 
AND c.product_id = d.product_id
AND c.employee_id IN(SELECT subordinate_id FROM employee_permission WHERE manager_id = emp_id)
AND d.product_category_id = e.product_category_id
AND e.product_category_id = f.product_category_id) AS 'JAN',
(SELECT SUM(b.quantity) FROM sales a, sales_product b, employee_bin c, product d, product_category e 
WHERE a.id = b.sales_id 
AND DATE_FORMAT(a.sales_date,"%m-%Y") = CONCAT("02-",sales_year)
AND b.employee_bin_id = c.id 
AND c.product_id = d.product_id
AND c.employee_id IN(SELECT subordinate_id FROM employee_permission WHERE manager_id = emp_id)
AND d.product_category_id = e.product_category_id
AND e.product_category_id = f.product_category_id) AS 'FEB',
(SELECT SUM(b.quantity) FROM sales a, sales_product b, employee_bin c, product d, product_category e 
WHERE a.id = b.sales_id 
AND DATE_FORMAT(a.sales_date,"%m-%Y") = CONCAT("03-",sales_year)
AND b.employee_bin_id = c.id 
AND c.product_id = d.product_id
AND c.employee_id IN(SELECT subordinate_id FROM employee_permission WHERE manager_id = emp_id)
AND d.product_category_id = e.product_category_id
AND e.product_category_id = f.product_category_id) AS 'MAR',
(SELECT SUM(b.quantity) FROM sales a, sales_product b, employee_bin c, product d, product_category e 
WHERE a.id = b.sales_id 
AND DATE_FORMAT(a.sales_date,"%m-%Y") = CONCAT("04-",sales_year)
AND b.employee_bin_id = c.id 
AND c.product_id = d.product_id
AND c.employee_id IN(SELECT subordinate_id FROM employee_permission WHERE manager_id = emp_id)
AND d.product_category_id = e.product_category_id
AND e.product_category_id = f.product_category_id) AS 'APR',
(SELECT SUM(b.quantity) FROM sales a, sales_product b, employee_bin c, product d, product_category e 
WHERE a.id = b.sales_id 
AND DATE_FORMAT(a.sales_date,"%m-%Y") = CONCAT("05-",sales_year)
AND b.employee_bin_id = c.id 
AND c.product_id = d.product_id
AND c.employee_id IN(SELECT subordinate_id FROM employee_permission WHERE manager_id = emp_id)
AND d.product_category_id = e.product_category_id
AND e.product_category_id = f.product_category_id) AS 'MAY',
(SELECT SUM(b.quantity) FROM sales a, sales_product b, employee_bin c, product d, product_category e 
WHERE a.id = b.sales_id 
AND DATE_FORMAT(a.sales_date,"%m-%Y") = CONCAT("06-",sales_year)
AND b.employee_bin_id = c.id 
AND c.product_id = d.product_id
AND c.employee_id IN(SELECT subordinate_id FROM employee_permission WHERE manager_id = emp_id)
AND d.product_category_id = e.product_category_id
AND e.product_category_id = f.product_category_id) AS 'JUN',
(SELECT SUM(b.quantity) FROM sales a, sales_product b, employee_bin c, product d, product_category e 
WHERE a.id = b.sales_id 
AND DATE_FORMAT(a.sales_date,"%m-%Y") = CONCAT("07-",sales_year)
AND b.employee_bin_id = c.id 
AND c.product_id = d.product_id
AND c.employee_id IN(SELECT subordinate_id FROM employee_permission WHERE manager_id = emp_id)
AND d.product_category_id = e.product_category_id
AND e.product_category_id = f.product_category_id) AS 'JUL',
(SELECT SUM(b.quantity) FROM sales a, sales_product b, employee_bin c, product d, product_category e 
WHERE a.id = b.sales_id 
AND DATE_FORMAT(a.sales_date,"%m-%Y") = CONCAT("08-",sales_year)
AND b.employee_bin_id = c.id 
AND c.product_id = d.product_id
AND c.employee_id IN(SELECT subordinate_id FROM employee_permission WHERE manager_id = emp_id)
AND d.product_category_id = e.product_category_id
AND e.product_category_id = f.product_category_id) AS 'AUG',
(SELECT SUM(b.quantity) FROM sales a, sales_product b, employee_bin c, product d, product_category e 
WHERE a.id = b.sales_id 
AND DATE_FORMAT(a.sales_date,"%m-%Y") = CONCAT("09-",sales_year)
AND b.employee_bin_id = c.id 
AND c.product_id = d.product_id
AND c.employee_id IN(SELECT subordinate_id FROM employee_permission WHERE manager_id = emp_id)
AND d.product_category_id = e.product_category_id
AND e.product_category_id = f.product_category_id) AS 'SEP',
(SELECT SUM(b.quantity) FROM sales a, sales_product b, employee_bin c, product d, product_category e 
WHERE a.id = b.sales_id 
AND DATE_FORMAT(a.sales_date,"%m-%Y") = CONCAT("10-",sales_year)
AND b.employee_bin_id = c.id 
AND c.product_id = d.product_id
AND c.employee_id IN(SELECT subordinate_id FROM employee_permission WHERE manager_id = emp_id)
AND d.product_category_id = e.product_category_id
AND e.product_category_id = f.product_category_id) AS 'OCT',
(SELECT SUM(b.quantity) FROM sales a, sales_product b, employee_bin c, product d, product_category e 
WHERE a.id = b.sales_id 
AND DATE_FORMAT(a.sales_date,"%m-%Y") = CONCAT("11-",sales_year)
AND b.employee_bin_id = c.id 
AND c.product_id = d.product_id
AND c.employee_id IN(SELECT subordinate_id FROM employee_permission WHERE manager_id = emp_id)
AND d.product_category_id = e.product_category_id
AND e.product_category_id = f.product_category_id) AS 'NOV',
(SELECT SUM(b.quantity) FROM sales a, sales_product b, employee_bin c, product d, product_category e 
WHERE a.id = b.sales_id 
AND DATE_FORMAT(a.sales_date,"%m-%Y") = CONCAT("12-",sales_year)
AND b.employee_bin_id = c.id 
AND c.product_id = d.product_id
AND c.employee_id IN(SELECT subordinate_id FROM employee_permission WHERE manager_id = emp_id)
AND d.product_category_id = e.product_category_id
AND e.product_category_id = f.product_category_id) AS 'DEC'
FROM product_category f 
WHERE f.product_category_id BETWEEN 1 AND 3 
GROUP BY f.product_category_id
ORDER BY f.product_category_id;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `ytd_sku_sales` */

/*!50003 DROP PROCEDURE IF EXISTS  `ytd_sku_sales` */;

DELIMITER $$

/*!50003 CREATE  PROCEDURE `ytd_sku_sales`(sales_year YEAR, usr_id INT)
    READS SQL DATA
BEGIN
	DECLARE emp_id INTEGER DEFAULT 0;
	SELECT employee_id INTO emp_id FROM `user` WHERE id = usr_id;
	
	SELECT e.product_name, (SELECT SUM(b.quantity) FROM sales a, sales_product b, employee_bin c, product d 
WHERE a.id = b.sales_id 
AND DATE_FORMAT(a.sales_date,"%Y") = sales_year
AND b.employee_bin_id = c.id 
AND c.product_id = d.product_id
AND c.employee_id IN(SELECT subordinate_id FROM employee_permission WHERE manager_id = emp_id)
AND d.product_id = e.product_id) AS 'YTD',
(SELECT SUM(b.quantity) FROM sales a, sales_product b, employee_bin c, product d 
WHERE a.id = b.sales_id 
AND DATE_FORMAT(a.sales_date,"%Y") = sales_year-1
AND b.employee_bin_id = c.id 
AND c.product_id = d.product_id
AND c.employee_id IN(SELECT subordinate_id FROM employee_permission WHERE manager_id = emp_id)
AND d.product_id = e.product_id) AS 'SPLY'
FROM product e 
WHERE e.product_id BETWEEN 1 AND 8 
GROUP BY e.product_id
ORDER BY e.product_category_id;
    END */$$
DELIMITER ;

